
from typing import List


class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:
        rows = len(grid)
        columns = len(grid[0]) if rows else 0
        island_points = []
        islands = 0

        for i, row in enumerate(grid):
            for j, bit in enumerate(row):
                if bit == "0" or [i, j] in island_points:
                    continue

                # island_points = []
                child_queue = [[i, j],]

                # Start of BFS
                while child_queue:
                    x, y = child_queue.pop(0)

                    # find the 4 directional siblings
                    if 0 <= x - 1 < rows and grid[x - 1][y] == "1":
                        # if [x - 1, y] not in island_points:
                            if [x - 1, y] not in child_queue:
                                child_queue.append([x - 1, y])
                    if 0 <= x + 1 < rows and grid[x + 1][y] == "1":
                        # if [x + 1, y] not in island_points:
                            if [x + 1, y] not in child_queue:
                                child_queue.append([x + 1, y])
                    if 0 <= y - 1 < columns and grid[x][y - 1] == "1":
                        # if [x, y - 1] not in island_points:
                            if [x, y - 1] not in child_queue:
                                child_queue.append([x, y - 1])
                    if 0 <= y + 1 < columns and grid[x][y + 1] == "1":
                        # if [x, y + 1] not in island_points:
                            if [x, y + 1] not in child_queue:
                                child_queue.append([x, y + 1])

                    grid[x][y] = "0" # make it 0 since it is already counted

                # end of BFS
                islands += 1
        return islands


